import React from 'react';
import './index.css';

let count = 0;

function NumIncrement(){
  count++;
  return count;
}

function App(){
    return (
        <React.Fragment>        
        <h1 >{count}</h1>
        <button onClick={NumIncrement}>Click Me</button>
      </React.Fragment>
    )
}

export default App;
